import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Home from "./pages/Home";
import Canvas from './pages/canvas';

function App() {
  return (
    <Router>
      <Routes>
      <Route
                        exact
                        path="/"
                        element={<Home />}
                    />
      </Routes>
    </Router>
  );
}

export default App;
